import React, { useState } from "react";
import product_service from "../service/product_service";
const AddProduct = () => {

    const [product, setProduct] = useState({
        productName: "",
        description: "",
        price: "",
        status: "",
    });


    const handleChange = (e) => {

        const value = e.target.value;
        setProduct({ ...product, [e.target.name]: value })
    }

    const ProductRegister = (e) => {
        e.preventDefault();
       product_service.saveproduct(product).then((res)=>{

       }).catch();
    }


    return (
        <>
            <div className="container mt-3">
                <div className="row">
                    <div className="col-md-6 offset-md-3">
                        <div className="card">
                            <div className="card-header fs-3 text-center">Add Product Details </div>
                            <div className="card-body">
                                <form onSubmit={(e) => ProductRegister(e)}>
                                    <div className="mb-3">
                                        <label>Enter Product Name </label>
                                        <input type="text" name="productName" className="form-control" onChange={(e) => handleChange(e)} />
                                    </div>
                                    <div className="mb-3">
                                        <label>Enter Description </label>
                                        <input type="text" name="description" className="form-control" onChange={(e) => handleChange(e)} />
                                    </div>
                                    <div className="mb-3">
                                        <label>Enter Price </label>
                                        <input type="text" name="price" className="form-control" onChange={(e) => handleChange(e)} />
                                    </div>
                                    <div className="mb-3">
                                        <label>Enter Status </label>
                                        <input type="text" name="status" className="form-control" onChange={(e) => handleChange(e)} />
                                    </div>
                                    <button className="btn btn-primary col-md-12">Add Product</button>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}
export default AddProduct
